import React from 'react';
import {AiOutlineReload} from 'react-icons/ai';
import axios from 'axios'
import $ from "jquery"


const baseURL = process.env.REACT_APP_URL

const GenerateMenu =() => {
    function Post() {
      axios.post(baseURL, {
        age: $("#age").text(),
        gender: $("#gender").val(),
        height: $("#percentage").val(),
        weight: $("#servings").val(),
        days_per_week: $("#difficulty :selected").text(),
        experience: $("#holiday :selected").text(),
        goal: $("#goal :selected").text()
      })
      .then(function (response) {
        console.log(response);
      })
      .catch(function (error) {
        console.log(error);
      });
    }

    return (
        <button type="button" className="btn btn-success" onClick={Post} id="Generate">
            Generate <AiOutlineReload />
        </button>
    )
}

export default GenerateMenu
